import React from 'react';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
          <Route path="/" element={<DailyTodo/>}/>
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
